import React from 'react'
import '../styles/Cards.css';

const Cards = ({ name, id, email }) => {
    return (
        <div className="main-wrapper">
            <div className="cards-wrapper">
                
                <h3>{name}</h3>
                <h4>{email}</h4>
            </div>
        </div>
    )
}

export default Cards;
